function assemblyDataStrict(params1,callback){
  var url = "http://picgif.fdc.com.cn/sec";
  // var url = "http://192.168.1.196/router/rest";
  getAccessToken("Get",url,params1,callback);
}

function assemblyData(params1){
  return sortData(params1);

}

function getAccessToken(type,url,params,callback){
  params["app_key"] = app_key;
  var method = "picgif.secuity.inter.generate.accesstoken";
  var tempMethod = params["method"];
  params["method"] = method;
  var accessToken = "";
  var temp = sortData(params);
  jQuery.ajax({
      type: type || "Get",
      url: url,
      data: temp,
      //async:false,
      dataType: "jsonp",
      jsonp:'uccallback',
      success: function(res){
        if(res["secuity_inter_generate_accesstoken_response"]){
          accessToken = res["secuity_inter_generate_accesstoken_response"].data;
           if(!accessToken){
              console.log("令牌获取失败");
              return;
            }
            params["accessToken"] = accessToken;
            params["method"] = tempMethod;
            delete params.signature;
            var params1 = sortData(params);
            $.ajax({
                type: "GET",
                dataType: "jsonp",
                jsonp:"uccallback",
                url:"http://picgif.fdc.com.cn/sec",
                // url:"http://test.uc.fdc.com.cn/router/rest",
                data: params1,
                success: function(res){
                  if(callback){
                    callback(res,"secuity_inter_sms_send_response");
                  }
                },
                error: function(res){
                  console.log(params.method+">>"+res.responseText);
                }
            });


        }else if(res["error_response"]){
          console.log(res.error_response.msg);
        }
      },
      error: function(res){
        console.log(method+">>"+res.responseText);
      }
  });
}

function sortData(params1){
  var arr = new Array();
  for(var k in params1){
    if(!empty(params1[k])&&(k!='_' && k.indexOf('callback')==-1  && k!='signature') ){
      arr.push(k);
    }

  }
  arr.sort();
  var temp = {};
  for(var i=0;i<arr.length;i++){
    temp[arr[i]]=params1[arr[i]];
  }
  var sortStr = "";
  for(var k in temp ){
    sortStr += (k+temp[k]);
  }
  var reStr = md5(sortStr);
  temp["signature"]=reStr+"fdc";
  return temp;
}

function empty(data)
